// ================= PIPE DATA =================
const pipes = [
 {inch:'1/2"',mm:21.7,thk:2.77,price:56},
 {inch:'3/4"',mm:26.7,thk:2.87,price:70},
 {inch:'1"',mm:33.4,thk:3.38,price:108},
 {inch:'1.25"',mm:42.2,thk:3.56,price:149},
 {inch:'1.5"',mm:48.3,thk:3.68,price:175},
 {inch:'2"',mm:60.3,thk:3.91,price:233},
 {inch:'2.5"',mm:73,thk:5.16,price:370},
 {inch:'3"',mm:88.9,thk:5.49,price:499},
 {inch:'4"',mm:114.3,thk:6.02,price:710},
 {inch:'5"',mm:141.3,thk:6.55,price:964},
 {inch:'6"',mm:168.3,thk:7.11,price:1289},
 {inch:'8"',mm:219.1,thk:8.18,price:1939}
];

// ================= IMAGE PATHS =================
const logoPath = "data:image/png;base64,";  
const certPath = "data:image/png;base64,";  

// ================= GLOBALS =================
let allResults = [];
let includeVAT = false;  //   VAT  PDF
const row = document.querySelector("#rows tr");

// ================= HELPERS =================
function roundTo6(len){
    while(len % 6 !== 0) len++;
    return len;
}

function weightPipe(d, t, len){
    return ((d - t) * t * len * 0.025) / len;
}

function getBase64FromUrl(url){
    return new Promise((resolve)=>{
        const img = new Image();
        img.crossOrigin = "Anonymous";
        img.onload = function(){
            const canvas = document.createElement("canvas");
            canvas.width = this.width;
            canvas.height = this.height;
            const ctx = canvas.getContext("2d");
            ctx.drawImage(this,0,0);
            resolve(canvas.toDataURL("image/png"));
        }
        img.onerror = function(){ resolve(null); }
        img.src = url;
    });
}

// ================= CALCULATION =================
function calculate(){
    const d = parseFloat(row.querySelector(".diameter").value);
    const len_m_input = parseFloat(row.querySelector(".length").value); 
    let thk = parseFloat(row.querySelector(".thkInput").value);

    if(!d || !len_m_input) return;

    const pipe = pipes.find(p => p.mm >= d) || pipes[pipes.length - 1];
    const finalLen = roundTo6(len_m_input);

    let pricePerMeter = 0;
    let total = 0;

    if(!thk){
        thk = pipe.thk;
        row.querySelector(".thkInput").value = thk;
        pricePerMeter = pipe.price;
        total = pricePerMeter * finalLen;
    } else {
        let pricePerTon = 40000;
        if((pipe.inch==='8"' && thk===8) || (pipe.inch==='6"' && thk===7))
            pricePerTon = 45000;

        const hiddenLen = finalLen + 0.02;
        const wpm = weightPipe(pipe.mm, thk, hiddenLen);
        pricePerMeter = (wpm * pricePerTon) / 1000;
        total = pricePerMeter * hiddenLen;
    }

    row.querySelector(".inch").innerText = pipe.inch;
    row.querySelector(".finalLength").innerText = finalLen.toFixed(2);
    row.querySelector(".price").innerText = pricePerMeter.toFixed(0);
    row.querySelector(".total").innerText = total.toLocaleString();

    allResults.push({
        inch: pipe.inch,
        thk: thk,
        len: finalLen,
        price: pricePerMeter,
        total: total
    });

    const grand = allResults.reduce((a,b)=>a+b.total,0);
    document.getElementById("grandTotal").innerText =
        `Grand Total: ${grand.toLocaleString()} EGP`;

    row.querySelector(".diameter").value = "";
    row.querySelector(".length").value = "";
    row.querySelector(".thkInput").value = "";
}

// ================= TOGGLE VAT =================
function toggleVAT(){
    includeVAT = !includeVAT;
    const btn = document.getElementById("vatBtn");
    btn.style.backgroundColor = includeVAT ? "#0d6efd" : "#fff";
    btn.style.color = includeVAT ? "#fff" : "#000";
}

// ================= PDF =================
async function generatePDF(){
    if(allResults.length===0) return alert("Add at least one pipe row!");

    const { jsPDF } = window.jspdf;
    const pdf = new jsPDF("p","pt","a4");

    const customer = document.getElementById("customerName").value || "N/A";

    // Logo
    let logoBase64 = await getBase64FromUrl(logoPath);
    if(logoBase64) pdf.addImage(logoBase64,"PNG",40,20,120,40);

    pdf.setFontSize(18);
    pdf.text("ELSAFWA STEEL",40,80);
    pdf.setFontSize(14);
    pdf.text("Pipe Quotation",520,80,{align:"right"});
    pdf.setFontSize(11);
    pdf.text(`Customer Name: ${customer}`,40,105);

    //  
    const tableData = allResults.map((r,i)=>[
        i+1,
        r.inch,
        r.thk,
        r.len.toFixed(2),
        r.price.toFixed(0),
        r.total.toLocaleString()
    ]);

    pdf.autoTable({
        startY:130,
        head:[["#","Inch","Thickness","Length","Price / M","Total"]],
        body: tableData
    });

    // Grand Total
    let y = pdf.lastAutoTable.finalY + 25;
    const grand = allResults.reduce((a,b)=>a+b.total,0);
    pdf.setFontSize(16);
    pdf.setTextColor(200,0,0);
    pdf.text(`Grand Total: ${grand.toLocaleString()} EGP`, pdf.internal.pageSize.width - 40, y, {align:"right"});
    pdf.setTextColor(0,0,0);

    // Terms
    y += 30;
    let terms = [
        "Terms:",
         "Duration of validity: One week from the Quotation Date",
        "Payment terms: 50% Advance & 50% against delivery",
        "Delivery: Ex works",
        "Company subject to advance payment system.",
        "Responsible persons: Mr. Nashat, Mr. Mohamed, Mr. Saed.",
        "Mobile: 01204209433 - 01281080302 - 01110055446 .",
        "Email: Sales@elsafwasteel.com",
        "Website: https://elsafwasteel.com/ar"
    ];

    if(includeVAT){
        terms.splice(1,0,"Prices include VAT.");
    }

    pdf.setFontSize(14);
    terms.forEach(t=>{
        pdf.text(t,40,y);
        y += 20;
    });

    // Certificate
    let certBase64 = await getBase64FromUrl(certPath);
    if(certBase64) pdf.addImage(certBase64,"PNG",120,pdf.internal.pageSize.height - 140,350,90);

    // Download PDF
    const blob = pdf.output("blob");
    const link = document.createElement("a");
    link.href = URL.createObjectURL(blob);
    link.download = "Pipe_Quotation.pdf";
    document.body.appendChild(link);
    link.click();
    setTimeout(()=>{
        document.body.removeChild(link);
        URL.revokeObjectURL(link.href);
    }, 1000);
}
